import InternalLayout from '../../components/InternalLayout';
import {useRouter, useEffect, useState} from 'next/router';
import CollapseAccodion from '../../components/CollapseAccordion';
import Profile from '../../components/Profile';

export default (props) => {
    const router = useRouter();
    // console.log(router.query.name)
    return <>
        <InternalLayout adminFlag='y'>
            <Profile dogID={router.query.name}/>
            <CollapseAccodion dogID={router.query.name}/>
        </InternalLayout>
    </>
}
